INSERT INTO `relato_sessao` VALUES (1,12,15,'49700236000120','Claudemiro Jesus da Silva','CRP','22011','2019-03-21','Testando inserção de dados na tabela RELATO DA SESSÃO, apenas testando a conexão por enquanto.'),(2,12,15,'49700236000120','Claudemiro Jesus da Silva','CRP','22011','2019-03-21','Testando agora, pra ver se a janela modal, na visualização vai aparecer de forma correta. '),(3,12,15,'49700236000120','Claudemiro Jesus da Silva','CRP','22011','2019-03-21','Testando com ENTER\r\nSem tratamento da String'),(4,12,15,'49700236000120','Claudemiro Jesus da Silva','CRP','22011','2019-03-21','Testando\r\ncom\r\nenter,\r\nporem\r\ncom\r\no\r\ntratamento da STRING\r\n.'),(5,12,15,'49700236000120','Claudemiro Jesus da Silva','CRP','22011','2019-03-21','Como de costume eu subi até a recepção para chamá-lo. Ele estava a minha espera, sentando e mexendo no celular.\r\nT. Boa tarde M. vamos lá?\r\nP. Boa tarde André, vamos!\r\nEntão descemos as escadas em direção à sala. Ao chegarmos ele prontamente se dirigiu ao divã e começou seu relato.\r\nP. Essa semana aconteceu algumas coisas que me fizeram sentir um mix de sentimentos?\r\nT. Como assim um mix de sentimentos?\r\nP. Ah... uma mistura de sensações, boas e ruins. Por exemplo, tive uma resposta daquele processo seletivo que eu estava esperando e não fui aprovado, uma outra menina foi chamada. Puxa, eu esperava que fosse contratado. Acredito ter ido bem em todas as etapas, na prova, na entrevista. Mas não foi dessa vez.\r\nT. E como você reagiu a essa resposta?\r\nP. Eu esperava passar mesmo. Além do fato de eu precisar de emprego, penso que fiz um bom processo, dei meu melhor, meu currículo é até razoável... Eles até falaram que eu tinha o perfil para vaga, que me encaixava nas expectativas deles, mas eu não sei o que eles esperavam. E é por isso que veio essa mistura de sentimentos. Tenho a impressão de que sou um bom candidato, mas quando eu não sou aprovado parece que eu não sou bom o suficiente, sabe?\r\nT. Me fala um pouco mais sobre esse sentimento.\r\nP. As vezes me sinto incapaz. Sei do meu potencial, das minhas capacidades, mas as vezes eu não sei como me posicionar ou o que pensar. Por exemplo a F. (namorada), ela me faz sentir inseguro quando fala sobre meus erros. Que eu não chego no horário, que eu não faço as coisas que ela quer e do jeito dela... Parece que nunca está bom, sempre tem algo de ruim que ela quer apontar em minhas atitudes.\r\nT. E como você se vê?\r\nP. Não me vejo egoísta, por exemplo. Sei que busco meu espaço, busco fazer minhas coisas, mas não deixo de procurá-la, de dar atenção, mesmo quando ela fica emburrada ou brava comigo por algum motivo. Aí tenho que escutar dela que eu sou muito folgado, que quero as coisas sempre do meu jeito. E eu não acho isso verdadeiro. Procuro sempre pensar na gente quando vou planejar algumas coisas, pergunto se ela tem interesse em fazer um programa ou outro, essas coisas... Aí me pego pensando se sou tão egoísta assim, ou se não sou bom o suficiente para conseguir um emprego, apesar de falarem que sou um bom candidato.\r\nT. Quem está falando sobre você, é você ou são os outros? \r\nSegue-se um breve silêncio.\r\nP. Difícil isso... acho que por isso me vem esse mix de sentimentos...\r\nT. Me parece que a influência da fala das outras pessoas em você é tão grande que você se contesta o tempo todo... quase se como sua identidade fosse colocada em questão.\r\nP. Sim... é verdade... as vezes parece que eu nem sei mais quem sou.\r\nSegue-se um breve silêncio.\r\nP. E é dentro do relacionamento com F. que eu vivencio isso. Eu queria tanto que fosse diferente, que ela fosse diferente, que não brigasse tanto pelas coisas. Tudo vira sempre uma grande discussão que as vezes nem dá vontade de falar nada.\r\nT. E como você gostaria que F. fosse?\r\nP. Ah, eu queria um companheira, que me respeitasse do jeito que eu sou, que me acompanhasse, que pudéssemos nos divertir, curtir. Mas tem sido tudo tão pesado já há um bom tempo que nem sei mais... Já tem um tempão que está assim... Aí penso em terminar para poder procurar uma pessoa assim, por outro lado eu gostaria de poder fazer isso com F., gosto dela.\r\nT. Me parece que você tem duas F., uma ideal e uma real. E que as duas não estão nem de perto sendo a mesma pessoa. Você deseja um relacionamento ideal, mas está com uma pessoa real, com suas qualidades e defeitos.. Será que essa pessoa ideal existe?\r\nE então mais um momento de silêncio.\r\nP. Pode ser que não... mas entendo o que você quer dizer... Eu tenho uma expectativa de um relacionamento, mas no dia a dia não está acontecendo e eu não sei o que fazer...\r\nT. E aí eu trago novamente sua fala descrita como mix de sentimentos. Talvez você tenha uma dificuldade em se encontrar, constituir uma identidade que possa se fortalecer para suportar a fala dos outros e, então, buscar aquilo que você quer.\r\nP. Sim, exatamente... me sinto assim, repensando a todo tempo quem eu sou de acordo com o que os outros falam.\r\nT. Em outras sessões falamos muito sobre a importância desse seu fortalecimento interno, e as suas experiências tem contribuído para isso, seu antigo emprego, seus planos para buscar um apartamento sozinho... percebo um desejo de fortalecimento interno.\r\nP. É verdade... e talvez por isso também meu relacionamento não está dando certo... preciso pensar mais sobre isso...\r\nT. Nossa sessão está se encerrando... Procure ficar com essa reflexão sobre que fala sobre você, se há uma voz interna que você reconhece como sendo sua ou se a fala dos outros estão determinando quem você é, suas escolhas e caminhos...\r\nP. Perfeito... vou me empenhar nisso... obrigado.\r\nT. Tenha uma boa semana e até a próxima sessão.\r\nP. Obrigado André, até a próxima.'),(6,12,15,'49700236000120','Claudemiro Jesus da Silva','CRP','22011','2019-03-21','Testando sessão seguinte '),(7,12,15,'49700236000120','Claudemiro Jesus da Silva','CRP','22011','2019-04-02','Testando em outro dia e outro atendimento'),(8,62,0,'49700236000120','Claudemiro Jesus da Silva','CRP','22011','2019-04-03','Testando sessão\r\nde um contato\r\nque esta armazenado no Lead\r\n');
